const HexBrand = Symbol.for('Hex');

const Hex = Schema.String.pipe(Schema.pattern(/^#[a-fA-F0-9]{6}$/)).pipe(
  Schema.brand(HexBrand)
);

const ColourOrHex = Schema.Union(Colour, Hex);

